import React, { Component } from 'react';
import { Container} from 'react-bootstrap';

class listarUsuarios extends Component {
    render() {
        return (
            <Container>
                <div flex >
                <h1>Usuarios</h1>
                </div>
            </Container>
        );
    }
}

export default listarUsuarios;
